(function() {
  var app;

  app = angular.module('superhero', []);

  app.directive('superman', function() {
    return {
      restrict: 'E',
      template: "<div>Here I come to SAVE the day</div>"
    };
  });

  app.directive('flash', function() {
    return {
      restrict: 'A',
      link: function() {
        return alert("I'm working");
      }
    };
  });

  app.directive('batman', function() {
    return {
      restrict: 'C',
      link: function() {
        return console.log("I'm Batman");
      }
    };
  });

}).call(this);
